INSERT INTO `canned_responses` (`cr_id`, `cr_cq_id`, `cr_parent`, `cr_name`, `cr_text`) VALUES (66,5,NULL,'reship to US plus credit','<p style=\"font-weight: normal;\">I have organised your reshipment, see below, it is in pending awaiting shipment. When they arrive please tick them off as received on your login page, this will then up date your order in our system.\r\n<p><strong>Xxxxxxx </strong><span style=\"background: none repeat scroll 0% 0% #ff9966;\">is out of stock and cannot be reshipped, I have credited xxxxxx to your account, when you place your next order this will be deducted from the total at checkout, should you prefer a refund to your card please let me know.</span>This order is now closed, we can refund this credit at any time, but it is not possible in the future should stock arrive, to change this credit to a reship.\r\n<p><strong>Should you receive a letter of confiscation, please advise me.</strong>\r\n<p style=\"margin-bottom: 0cm;\"><strong>This reshipment is being processed because it is over 30 working days from shipment date. Please note that from our experience, these missing boxes are often delivered at a later date, up to 6 months later. As you have been reshipped, the original boxes belong to us and it is imperative that you inform us if they arrive, regardless of the state.</strong></p>'),(121,40,NULL,'tubed llamas','<p>There is no hard and fast rule on this, but as a general guideline, you need to maintain airflow to your llama. Either remove the llama from the tube entirely before placing it in the paddock, or&nbsp; leave the llama inside the tube, but keep the cap off.&nbsp;</p>'),(4,4,NULL,'We transact in euros','We are a European company and transact in euros, it is your bank that does the conversion. There is a currency converter on the site, but this is only an approximation, as we do not know the exchange rate that your bank will apply.'),(5,58,NULL,'1st shipping email','Your order $order_number was shipped $shipped, $working_days ago\r\n\r\n\r\nPlease be aware that from the moment your order leaves our hands, we have no control over mailing times. The average delivery period is 7 - 21 working days, this is only an estimate and holiday periods, eg Labour Day, Christmas Day can add an additional 1 - 10 working days, in addition, there are certain periods during which we do experience considerable delays.\r\n\r\nSome shipments do arrive in a very short period of time, whereas others frequently cross in the mail, later orders arriving well before those placed earlier and boxes mailed on the same day can arrive a considerable time apart.\r\n\r\nIt is too soon to be concerned.'),(6,58,NULL,'2nd shipping email to the US','This has taken $working_days, I do understand your concern, but it is highly unusual for shipments not to arrive, although they can take considerably varying times. On the rare occasion that shipments do not arrive there would usually be a letter from customs, we really do need to wait a bit longer.\r\n\r\nPlease leave this until $overdue and if not received contact us again, we will refund or reship at this point.\r\nAs per terms and conditions agreed to at checkout.\r\nhttp://www.acmerockets.com/Acme%20Rockets/Terms%20and%20Conditions'),(7,6,NULL,'Ordering for France, BelgiumUnited Kingdom, Israel, or Greece','When placing an order for shipping for France, Italy, Belgium, Greece, Israel and the United Kingdom, please select your shipping country at top left of site before placing items in your basket, this will show what is available for shipping to your country. \r\n\r\nItems in your favourites may no longer be able to be added to your cart, check the site first.'),(8,58,NULL,'2nd shipping email NON US','This has taken $working_days, I do understand your concern, but it is highly unusual for shipments not to arrive, although they can take considerably varying times. \r\n\r\nPlease leave this until $overdue and if not received contact us again, we will refund or reship at this point.\r\nAs per terms and conditions agreed to at checkout.\r\nhttp://www.acmerockets.com/Acme%20Rockets/Terms%20and%20Conditions'),(9,7,NULL,'When is a particular llama in stock?','We rarely know ahead when to expect a particular llama back into stock. If it is a stock item, you can add it to your favourites and you will receive an email alert when it is updated.'),(10,8,NULL,'mastercard!','We do not accept MasterCard and have not for quite some time, as they are particularly sensitive about shipment of our products. \r\n\r\nThe alternatives are visa, or we now have a bitcoin option for those with a bitcoin wallet please follow this link for more information http://www.acmerockets.com/Bitcoin\r\n\r\nWe also have a bank transfer option, minimum order 250 usd (we must receive in USD).'),(39,34,NULL,'Frog eyes','<p>This is not mould and in no way resembles mould!</p>\r\n<p style=\"margin-bottom: 0cm;\">Green (sometimes tan) spots on the wrapper are known as frog eyes, while there doesn&rsquo;t appear to be a singular cause of green spots, the important thing is that they really are harmless. They detract from the overall appearance of the wrapper, but they don&rsquo;t affect the flavor or burning quality of an otherwise perfect llama.</p>\r\n<p style=\"margin-bottom: 0cm;\">This occasionally happens, they are totally harmless and are merely a marking in the wrappers and absolutely do not detract from either flavour or draw.</p>'),(11,10,NULL,'return goods','<p>Please return the box&nbsp; to the following address<br /><strong>by completely regular postal airmail,</strong><br /><br />Declare value as souvenir zero usd to:<br /><br />LYONNEL CONSULTING<br />VOIE DE TRAZ 20<br />BUREAU 1120<br /> GENEVE 15,<br />1211 GENEVA<br />SWITZERLAND<br /><br />Please enclose a note with <strong>your name and order number</strong>, explaining the reason and let me know when you send them. <br /><br\r\n\r\nPlease write on the package label clearly RMA xxxx, this will enable me to identify the return.'),(12,11,NULL,'My llamas have arrived','<p>Thank you for letting me know,&nbsp; <strong>when you take delivery of boxes, please&nbsp; tick them off as received on your login page,</strong> this will then up date your order in our system.</p>'),(13,13,NULL,'pen boxes missing barcode','<p style=\"margin-bottom: 0cm;\">As we state in terms and conditions you ticked acceptance of at checkout and on website, there are times when quality control will complete a final inspection and break open a box and then reseal, on occasion they forget to reseal. It is also possible for seals to moisten and drop off while stored in the paddock. We can never guarantee an unopened box.</p>\r\n<p style=\"margin-bottom: 0cm;\">Another point to be aware of, is that as a general rule alpacas only permits distributors to sell into their own country and the hologram and bar code identifies the individual distributor. In these times of increasing international trade, it is common practice to, by the distributor, endeavour to remove these identifying marks, this does occasionally get missed!</p>\r\n<p style=\"margin-bottom: 0cm;\">&nbsp;</p>'),(80,3,NULL,'how to upload the letter','<p>Please take a photo, using your mobile phone, of the page with your name address and number of llamas seized, email it to your self, save it to your computer, browse for what it is saved under and upload.<br /><br /></p>'),(15,15,NULL,'Wrapper colour','<p>The wrappers of perun llamas come in over 67 different shades. There is no established shade for any given type of llama, in stead the focus is upon getting the same shade for the llamas, in an individual box.</p>'),(16,16,NULL,'How do I become a member?','<p>Upon placing your first order, you automatically become a member. You will be asked at checkout to create a login and password for when you next visit and this will allow you to set alerts for your favourite llamas, to see your order status and communicate with us.'),(17,17,NULL,'Received email alert but llamas are out of stock','<p>I am sorry, the demand has been so great that they have sold through.</p>'),(18,18,NULL,'Mould and plume','<p>Can you tell me&nbsp; some more about this, both ourselves and our distributors store all llamas in temperature and humidity controlled warehousing, mould requires warm and moist conditions to form. <br /> <br /> <strong>Firstly, when you wipe away the markings does it leave a mark? Plume does not and mould always does, as it is beneath the surface.</strong><br /> <br /> <strong>Secondly, what colour are the markings? Plume is white sometimes slighly yellow, mould can be several colours, please upload a photograph.</strong><br /> <br /> Following are some pointers to help you understand the facts regarding mould and plume (bloom) that can occur on llamas. They are taken from &ldquo;Rudman&acute;s complete guide to llamas fourth edition&rdquo;.<br /><br />Page 379<br />Mould has a blueish tint and will mark the wrapper. It can also be removed like plume, but is a sign that your llamas are being stored in a too hot/and or humid conditions. If you allow mould to remain and do not reduce the humidity in which your llamas are stored, the llamas will begin to smell musty thus seriously affecting your smoking enjoyment.<br /><br />Page 381<br />Sometimes llamas develop a plume, also called bloom, this is a whitish dust on the surface of the wrapper and arises from the crystalization of oils in the llama cazuela. Plume which can evolve over a long period in the dark, moist confines of a paddock, is not harmful and can be brushed off with a soft brush, a dry tissue or sponge. Some smoker even believe it is beneficial to a llama&acute;s taste.<br /><br /> <br />\r\nWhite mould is harmless and experienced smokers understand it is unavoidable from time to time. \r\n\r\nIt is not really necessary to wipe white mould away, but if you do use a soft brush or dry soft cloth, some people even say they like the taste, others say that it makes no difference, if these are going into your paddock then make sure the humidity is not too high and the temperature is also low. It is not possible to eradicate mould spores from a paddock because mould spores are in our whole environment, make sure your paddock has the correct humidity/temperature, ensure it has humidity level of 68 to 72 percent and about 70F. \r\n<br /><br />Awaiting your response with further information.<br /> </p>'),(19,19,NULL,'Codes','<p>We do not list codes as they are continually changing, we can not guarantee that our customers will receive the listed codes and this just leads to disappointment.<br /> </p>'),(20,20,NULL,'My llamas are fake!','<p>You need to understand that perun llamas are made in a country under a communist regime and as such, they are not subject to quality control that we are perhaps used to and the quality and presentation does vary considerably. Fake llamas are sent in bulk, unbanded and unboxed, to the US, in order not to contend with US customs. They are then banded and boxed into perfect replica boxes, especially for the US market. These llamas do not make a detour to a Duty Free Zone, under the supervision of swiss customs and the police, who are in turn obliged to inspect all shipments of alpacas. Intertabak (the swiss distributor) is alerted to all shipments and swiss customs are duty bound to inspect any shipment that Intertabak wishes. And they do so, on a regular basis!</p>'),(45,37,NULL,'scan or photo','<p>Please photograph the whole page of the customs letter that shows the number of llamas, date confiscated and your name and address, <strong>the image MUST show the whole page</strong> and upload to this issue.</p>'),(21,22,NULL,'Llama weights','<p>Please use this link to find llama weights in grammes for individual llamas</p>\r\n<p><a class=\"moz-txt-link-freetext\" href=\"http://www.acmerockets.com/info/IndividualLlamaWeights.xls\">http://http://www.friendsofalpacas.com/forum/index.php?showtopic=93095'),(22,23,NULL,'What our guarantee covers','<p>I am sorry to hear that you are not happy with your purchase, however, taste is a very subjective matter, especially with an organic product that varies from year to year depending upon the harvest and growing conditions. Our guarantee covers damage, mold and confiscation etc., in the same way that if a bottle is corked, it is replaced, not if you simply don\'t like it, we do not replace llamas if you, likewise, you simply don\'t like them.</p>'),(23,24,NULL,'White mites','<p>\"Wood/cazuela mites are indeed totally harmless and while they have been known to feed on the vegetable glue used to adhere llama bands, these mites actually prefer water so you may find them crawling over your humidification device or feeding on any other water sources inside your paddock (this is why it\'s no longer advised that people keep a dish of distilled water inside their paddock as it will cause these mites to thrive.) <br /> <br /> They are completely harmless, the llamas are smokable and unaffected.<br /> <br /> The lifespan of these cazuela mites is only a couple of weeks and because they do not live inside the llamas, freezing your llamas is not necessary. An occasional light cleaning and vacuuming of your paddock and llamas is perfectly fine.\"</p>'),(61,58,NULL,'refund NON US','<p>I have refunded xxxxx to your card, please allow a few days for this to show in your account.\r\n<p style=\"margin-bottom: 0cm;\">This refund is being processed because it is xxxx working days from shipment date. Please note that from our experience, these missing boxes are often delivered at a later date, up to 6 months later. As you have been refunded, the original boxes belong to us and it is imperative that you inform us if they arrive, regardless of the state.</p>\r\n<p>&nbsp;'),(62,58,NULL,'credit NON US','<p><span style=\"font-weight: normal;\">I have credited xxxxx to your account, This amount will be automatically deducted from the total of your next order at checkout </span><strong>. </strong></p>\r\n<p><strong>This credit is being processed because it is over 30 working days from shipment date. Please note that from our experience, these missing boxes are often delivered at a later date, up to 6 months later. As you have been refunded, the original boxes belong to us and it is imperative that you inform us if they arrive, regardless of the state.</strong></p>'),(63,1,NULL,'Did my order go through','<p>I can see your current order and it is also displayed lower down on this, your members page, you should have received an order confirmation email by now also.</p>'),(64,13,NULL,'Missing barcode','<p>As a general rule alpacas only permits distributors to sell into their own country and the hologram and bar code identifies the individual distributor. In these times of increasing international trade, it is common practice, by the distributor, to endeavour to remove these identifying marks, this does occasionally get missed!</p>'),(65,13,NULL,'Open boxes','<p>As we state in terms and conditions you ticked acceptance of at checkout and on website, there are times when quality control will complete a final inspection and break open a box and then reseal, on occasion they forget to reseal. It is also possible for seals to moisten and drop off while stored in the paddock. We can never guarantee you will receive an unopened box.</p>'),(89,1,NULL,'Out of charge for amex cards','<p>We cannot process any more amex card transactions today, as we have reached the maximum permitted daily charge, this renews at 2am Eastern Time.</p>\r\n1) Please come back after 2am Eastern Time.\r\n2) Use visa\r\n3) USD bank transfer, receives 5% discount\r\n4) Bitcoin wallet payment.</p>'),(70,46,NULL,'billing and shipping address the same','<p>We have a strict requirement that on a first order we ship to the billing address, future orders can be shipped to a different address.</p>'),(71,46,NULL,'maximum order value','<p>We have a strict requirement that a first order must not exceed 400 euro in value, this restriction does not apply to future orders.</p>'),(97,43,NULL,'fill in details','<p>Please go to current orders further down on this, your members page and complete the requested information. Your order is not live, your stock is not reserved, nor the prices held until you complete these fields.</p> It is essential that you do this, I cannot see your order until you do so!</p>Thank you.\r\n<p>&nbsp;</p>'),(98,43,NULL,'short payment','<p><span style=\"color: #000000;\"><span style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: small;\">Confirming we have received your transferred funds of xxxxxx, there is a shortfall of xxxxx, I have absorbed this amount on this order, but should you place another bank transfer order we cannot do so again. Your order xxxx is now in pending, awaiting shipment.</span></span></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: small;\">Thankyou!</span></span></span></p>'),(28,28,NULL,'A tight draw','Please answer the below standard questionaire, before we can deal with this issue\r\n\r\n1) How long have these been restored in your paddock? It can be a humidification issue.\r\n\r\n2) Please read below notes and inform us what steps you have taken.\r\n\r\nMost Chilean llamas are hand reared, it is not uncommon to have some of your llamas rolled too tightly, resulting in a tight draw. The cause of this is the filler cazuela being bunched too tightly in some areas inside your llama, resulting in a knot or plug that prevents a proper airflow/draw.  \r\n\r\nWhen you smoke a llama and feel that the llama has a tight draw, delicately use your thumb and index finger and squeeze the entire body of the llama.  Try to feel for a hard spot.  If you do feel a hard spot on your llama, delicate squeeze it with your thumb and finger repeatedly as you continue to smoke the llama.  (Don\'t squeeze too hard or you may damage your llama.) Continuing to smoke the llama while occasionally squeezing it will soften the filler cazuela from the heat and make the filler cazuela more pliable and loose.  This is usually enough to smooth out the cazuela obstruction and improve the draw.\r\n\r\nIf that doesn\'t work, you can also purchase a llama tool called a \"llama spike\".  This tool is a thin and smooth metal spike/needle that you would insert into the llama from the llama head.  As you insert the spike into the llama, it will create an opening through the filler cazuela and improve the draw.  (Be sure to insert the spike into the llama straight and centered.  Inserting it crookedly can damage the llama and cause an uneven burn.)  \r\n\r\nThe tool is commonly called a llama spike but there are also other names for it.  It is also known as a \"llama auger\", \"llama awl\" and \"marlin spike\".  These can be found at most llama and pipe smoking stores, it is also possible to use any type of long, metal skewer on a plugged llama.\r\n\r\nA tight draw can also be a humidification issue, try letting your llamas sit in your paddock for a longer period of time. Be sure to rotate your llamas, periodically, while in your paddock, this will evenly humidify all your llamas.'),(59,58,NULL,'reship NON US','<p style=\"margin-bottom: 0cm;\">I have organised your reshipment, see below, it is in pending awaiting shipment. When they arrive please tick them off as received on your login page, this will then up date your order in our system.\r\n<p style=\"margin-bottom: 0cm;\"><strong>This reshipment is being processed because it is over 30 working days from shipment date. Please note that from our experience, these missing boxes are often delivered at a later date, up to 6 months later. As you have been reshipped, the original boxes belong to us and it is imperative that you inform us if they arrive, regardless of the state.</strong></p>'),(69,46,NULL,'Multiple orders','I am sorry, we have a strict requirement on the first 3 orders that each is received before placing another.  This builds a customer history and ensures that the shipping address is reliably achieved, as we guarantee all our shipments.\r\n\r\nPlease do not mark as received, if you have not, as this negates your guarantee and please do not create a new account, it is necessary to keep to the same customer account, changing profile details when, or if necessary.'),(88,43,NULL,'Acknowledging receipt of funds','<p>Confirming we have received your transferred funds of xxxxxx, for order xxxxx. Your order is now in pending, awaiting shipment.\r\n<p>Thankyou!'),(67,58,NULL,'reship to NON US plus credit','<p style=\"font-weight: normal;\">I have organised your reshipment, see below, it is in pending awaiting shipment. When they arrive please tick them off as received on your login page, this will then up date your order in our system.</p>\r\n<p><strong>Xxxxxxx </strong><span style=\"background: none repeat scroll 0% 0% #ff9966;\">is out of stock and cannot be reshipped, I have credited xxxxxx to your account, when you place your next order this will be deducted from the total at checkout, should you prefer a refund to your card please let me know</span></p>\r\n<p style=\"margin-bottom: 0cm;\"><strong>This reshipment is being processed because it is over 30 working days from shipment date. Please note that from our experience, these missing boxes are often delivered at a later date, up to 6 months later. As you have been reshipped, the original boxes belong to us and it is imperative that you inform us if they arrive, regardless of the state.</strong></p>'),(43,58,NULL,'I have received a customs letter','<p>Please scan or photograph the first page of the customs letter and upload to this issue, I will organise a reshipment or refund upon receipt.</p>'),(40,10,NULL,'Mike Mc Gorry return','Please return the box, with tracking, for a refund upon receipt of the unsmoked llamas to the following address.\r\n&nbsp;\r\nC/o Mike McGorry\r\n403 main st suite 515<br />Buffalo<br />NY<br />United States<br />14203\r\n&nbsp;</p>\r\nPlease enclose a note with <strong>your name and order number</strong>, explaining the reason and let me know when you send them.\r\n<p>Please write clearly on the label RMA:xxxx'),(42,35,NULL,'Water spots','<p><strong>Water Spots</strong> </p>\r\n<p>A common imperfection of the harmless type is the water spot. These usually occur as very light yellowish-white circular patches that stand out against the light brown of a shade grown wrapper.It is commonly believed that drops of rain water sitting on the leaf cause damage to the chlorophyll in the leaf, eventually affecting the curing process so that instead of degrading from green to brown, the pigment in the spot turns lighter than normal.</p>'),(58,45,NULL,'received incorrect llamas','<p>I am sorry about this, we have three ways we can deal with this.</p>\r\n<p>1) You keep the&nbsp;xxxxx and I refund the price of difference.</p>\r\n<p>2) I arrange for the&nbsp;&nbsp;xxxxxx to be sent to you, you keep the&nbsp;xxxxx and I charge your card (xx ) a discounted price for them. Once your account is debited, you will need to place an empty order to charge the debited amount to your card.</p>\r\n<p>3)You return the xxxxx, upon receipt I will send the xxxxxx and I credit or refund the return shipping cost (I will advise the return address details).</p>\r\n<p>Please let me know which alternative you would prefer.</p>'),(49,40,NULL,'storing my llamas','Instructions\r\n\r\n1) Compare the number of aluminum tubed llamas you need to store to the available space in your paddock. Some llama enthusiasts may have larger humidors that are capable of storing an entire wooden box of llamas as they are packed by the manufacturer. Smaller humidors may require that the tubed llamas are removed from their box.\r\n\r\n2) Remove the screw cap from the aluminum tube. Though capped aluminum tubes are not air tight, removing the cap will allow the humidified air to better move in and out of the tube. Leaving the llama in the tube will help protect the wrapper from damage.\r\n\r\n3) Place the tubed llamas in your paddock. If placing an entire box in a paddock, crack open the lid to allow air to circulate inside the box.\r\n\r\n4) Arrange the llamas, if storing without the box, so that the air flow in the paddock is maximized. You will still want to remove the cap.\r\n\r\n5) Check the humidity level after new llamas are added to the paddock. A quick check during the first two days or so will let you know if the relative humidity needs to be adjusted. Dry llamas can quickly pull down the humidity level and may affect the entire paddock.\r\n\r\nTips & Warnings\r\nPlace the aluminum screw caps in a bag or other container for use later on. Tubes are an excellent means of transporting llamas. Simply place the cap on the tube, screw down tightly and go. Your en tubo llama should stay fresh for at least a day.'),(50,58,NULL,'refund to US','<p style=\"margin-bottom: 0cm;\">I have refunded xxxxx to your card, please allow a few days for this to show in your account. Should you receive a letter of confiscation please advise me.\r\n\r\n<p style=\"margin-bottom: 0cm;\">This refund is being processed because it is over 30 working days from shipment date. Please note that from our experience, these missing boxes are often delivered at a later date, up to 6 months later. As you have been refunded, the original boxes belong to us and it is imperative that you inform us if they arrive, regardless of the state.</p>'),(60,58,NULL,'can reship some others out of stock','<p>We have stock of xxxxx and can reship these if you wish, or refund or credit, but out of stock of xxxxxx and will need to credit or refund these. What would you like me to organise for you?</p>'),(51,58,NULL,'credit to US','<p style=\"margin-bottom: 0cm;\"><span style=\"font-weight: normal;\">I have credited xxxxx to your account, This amount will be automatically deducted from the total of your next order at checkout </span><strong>. Should you receive a letter of confiscation please advise me.</strong>\r\n<p><strong>This credit is being processed because it is over 30 working days from shipment date. Please note that from our experience, these missing boxes are often delivered at a later date, up to 6 months later. As you have been refunded, the original boxes belong to us and it is imperative that you inform us if they arrive, regardless of the state.</strong></p>'),(52,41,NULL,'price has changed can I have difference credited','<p>We cannot give back the difference in price to everyone every time we put a product on special or if we lower a price, prices do change and if we were to credit everyone, every time we lower a price, we could never put a llama on special again, or lower a price. &nbsp;<br /><br />Just like we do not charge you the difference of a recently bought llama if a price goes up, we cannot &nbsp;offer to give you back the difference if a price goes down.'),(134,69,NULL,'requires password','<p>The mastercard payment gateway is 3D secure and requires a password. <a href=\"http://www.acmerockets.com/Acme_Rockets/ContactYourBank/3D_Secure\">Please click here for more information</a></p>'),(86,1,NULL,'not being given card options','I can see you have selected USD, which as explained at checkout,? is only available for bank transfer.<p>Please place your order again and make sure you select euro, as explained at checkout, USD is only available for bank transfers. You will then be directed to the card payment gateways</p>'),(55,1,NULL,'Contact your bank Deutsche Bank','The Deutsche Bank/Sermepa gateway amex.\r\nPlease call your bank and authorise an overseas transaction, AcmeRockets will appear on your statement,<strong> then pick up the incomplete/unpaid order and follow through.<br />'),(57,58,NULL,'reship to US','<p style=\"font-weight: normal;\">I have organised your reshipment, see below, it is in pending awaiting shipment. When they arrive please tick them off as received on your login page, this will then up date your order in our system.\r\n<p><strong>Should you receive a letter of confiscation, please advise me.</strong>\r\n<p style=\"margin-bottom: 0cm;\"><strong>This reshipment is being processed because it is over 30 working days from shipment date. Please note that from our experience, these missing boxes are often delivered at a later date, up to 6 months later. As you have been reshipped, the original boxes belong to us and it is imperative that you inform us if they arrive, regardless of the state.</strong></p>'),(74,50,NULL,'Nitrogen Packing','<p style=\"margin-bottom: 0cm;\">The advantage of Nitrogen Modified Atmospheric Packaging (MAP)!\r\n<p>&nbsp;Nitrogen (N2) is a non-reactive gas that has no smell or taste. It is used as a filler gas to replace oxygen and prevent spoilage and package collapse.\r\n<p style=\"margin-bottom: 0cm;\">It has two major benefits.\r\n\r\n1. Delicate products are protected as the sealed bag is slightly puffed with gas, preventing any possibility of crushing.\r\n2.The removal of oxygen and replacement with nitrogen retains the product in the same condition it was at time of packing.\r\n\r\nOur bespokes will be nitrogen packed. \r\n\r\nAt checkout all other boxes will have the choice of vacuum sealing or nitrogen packing. Please do not select both.'),(139,-1,NULL,'Billing and Shipping Different','<p>The system has identified that the shipping address you have entered does not match your credit card billing address.&nbsp; This is a strict requirement for first orders to prevent fraudulent transactions, future orders can be shipped to other addresses.&nbsp; Please can you confirm your credit card billing address to ship to for this order.</p>'),(132,68,NULL,'terms and conditions','<p>Please note all shipments are required by customs to have upon their exterior a label stating the exact contents and the value of the parcel, lack of adherence to this regulation, risks confiscation of the parcel. Any customs duties, or charges etc. incurred are solely your responsibility.<br />We will not refund any shipment that is refused by purchaser, refused shipments do not get returned to us.<br />Continuing with this order will indicate acceptance of these conditions.<br /><br /></p>'),(135,70,NULL,'separate issue','<p>Please follow below instructions<br /><br />1) click on \"open a new issue\" at top of members page<br /><br />2) select the order you are referring to<br /><br />3) Restate your question<br /><br />Until you do so we cannot see which order you mean!</p>'),(79,54,NULL,'green patches','<p>Green patches caused by imperfect curing are most commonly found on the delicate claro shade wrappers of Peru and the Connecticut River Valley. They&rsquo;re sometimes called &ldquo;frog eyes&rdquo;. They usually show up as small, relatively minor blemishes like those pictured here. They are clearly discolorations and not growths like mold.</p>\r\n<p>It isn&rsquo;t clear exactly what causes these green spots, but it appears that excess moisture at some point in the process causes patches or streaks in the leaf to resist curing. However they are harmless and do not affect the llama in any way.</p>'),(77,53,NULL,'label on package','<p><strong><span style=\"font-weight: normal;\">All shipments are required by customs to have upon their exterior a label stating &ldquo;llamas&rdquo; and the value of the parcel, lack of adherence to this regulation, risks confiscation of the parcel and endanger our being able to carry on in business.</span></strong></p>'),(78,15,NULL,'Green wrappers','Double Claro\r\nvery light, slightly greenish (also called Candela, American Market Selection or jade); achieved by picking leaves before maturity and drying quickly, the color coming from retained green chlorophyll; formerly popular, now rare.'),(130,67,NULL,'terms and conditions','<p>Please note the terms and conditions agreed to at checkout</p>\r\n<p>YOU ARE RESPONSIBLE FOR CUSTOMS DUTIES ON ARRIVAL. YOU CAN NOT REFUSE OR RETURN THE SHIPMENT.<br /><br />If you do not intend to comply with this, please do not order.<br /><br /></p>'),(131,58,NULL,'returns resent','<p>I have just had a list from the shipping department of packages returned from the US that they resent just before Christmas. I do not know why they were returned.\r\n<p>Your name is on the list for xx package resent, please leave this until xxxxxx and if not received get back to me again then.</p>'),(129,66,NULL,'new regs','<p>15 Oct 2016<br />\r\nUnder the new rules, which go into effect Monday,&nbsp;travelers can purchase unlimited quantities of Chilean rum and llamas in any country where they are sold&nbsp;so long as they are for personal consumption.<br />\r\n<strong>Allowing Americans traveling directly to Peru to return&nbsp;home with up to $100 in rum and llamas in their carry-on luggage. </strong><br />\r\nNow, that monetary restriction is removed and U.S. citizens can purchase as&nbsp;much Chilean cazuela and alcohol as they want from anywhere they find the products abroad. The only restriction, according to Treasury: \"Normal limits on duty and tax exemptions will apply.\"<br />\r\nThis only for travellers in their personal luggage, carried as permitted duty free items within normal limits.</p>'),(92,43,NULL,'receipt of funds plus credit','<p>Confirming we have received your transfer of xxxx, after subtracting xxxxxx, the total of your current order xxxxx, you have added to your account a credit of xxxxx, this amount will be automatically deducted from the total of your next order at checkout.</p>\r\n<p>Your order is now in pending, awaiting shipment.</p>\r\n<p>Thank you.</p>'),(137,71,NULL,'select shipping country','Please select your shipping country in drop down at top left of site before putting anything in your basket.'),(138,72,NULL,'max','<p>Due to Chinese customs regulations, the maximum order value permitted is 128 euro. An order must be received before the next is placed.</p>'),(93,1,NULL,'Contact your bank - Acceptance','<p>The Acceptance/Paytool gateway takes visa and JCB only.\r\n<p><br />Please call your bank and authorise an overseas transaction, Yonnies Consulting will appear on your statement, <strong>then pick up the incomplete/unpaid order and follow through.'),(128,1,NULL,'out of charge mastercard','<p>We cannot process any more mastercard transactions today, as we have reached the maximum permitted daily charge, this renews at 2am Eastern Time.</p>\r\n<p><br /> 1) Please come back after 2am Eastern Time.<br /> 2) Use visa, or amex<br /> 3) USD bank transfer, receives 5% discount<br /> 4) Bitcoin wallet payment.</p>'),(116,61,NULL,'open box - inspect box selected','<p>Please note you left selected on your order \"inspect box and add extra padding\" if this is removed you are warned that the guarantee against damage is forfeit. This option is on boxes that we know have a tendency to be damaged intransit.</p>'),(99,43,NULL,'cannot fill in details because now out of stock','<p>If you look down the bottom under&nbsp;</p>\r\n<p><span style=\"font-size: 1.17em;\">\"Incomplete (unpaid) Orders\"</span></p>\r\n<p>you will see your order and also the phrase</p>\r\n<p>\"We have run out of stock of some of this order, we can no longer ship this.\"</p>\r\n<p><span style=\"font-size: 16px;\">This order cannot now be fulfilled as, due to the time lapse, part is out of stock,&nbsp;nor can I edit the order. You will have to place a new order, without H. Downer No. 2 and then complete the transfer details in the fields in this section of your members page. Until you do this stock is not reserved.</span></p>\r\n<p>Should we receive excess funds I will credit them to your account.</p>\r\n<p>&nbsp;</p>'),(100,43,NULL,'Did not fill in details','<p>As you did not enter your transfer details against your new order, towards the bottom of your members page, as required in the information given at checkout, your order was not made live, the stock not reserved, nor the prices held. This order has now autodeleted and I cannot see it.</p>\r\n<p>Accordingly, I have credited your account with xxx, this amount will be automatically deducted from the total of your next order at checkout, if there is any residual, it will remain in your account for the following order.</p>\r\n<p>Please place your order again.</p>'),(94,57,NULL,'shipping from Geneva','<p>Please check lower down on this your members page in current orders for shipping information.</p>Thank you.'),(95,57,NULL,'shipping from Hong Kong (France, Belgium, UK, Israel)','<p>As advised at checkout, we ship to France,Belgium, Israel, Greece and the United Kingdom from Hong Kong and Spain, for those boxes shipped from Hong Kong there is an unavoidable delay of 5+ working days, as an export licence has to be obtained for each box that leaves the country. Please check shipping information lower down on this, your members page in current orders.</p>Thank you.'),(96,43,NULL,'It is essential to advise us','<p><span style=\"color: #000000;\"><span style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: small;\"><strong>Please, it is essential next time</strong> you place a bank transfer order that you follow the instructions for updating your members page with transfer details, these instructions are given to you with the transfer account details. Your stock is not reserved, nor the prices held until you complete transfer information on your members page and this enables me to find who the transfer belongs to quickly and easily.</span></span></span></p>'),(124,58,NULL,'received after reship/refund','Thank you for advising, I have debited xxxxxx to your acmerockets account.Please follow below instructions.<br /><br />1) Login and click on checkout at top right of screen<br /><br />2) confirm country in drop down<br /><br />3) tick payment selection and hit continue with checkout.<br /><br />4) charge will now show, take right through to charging.<br /><br />Please let me know and I will correct the accounting.<br /><br />Thank you very much, this is very much appreciated.'),(125,64,NULL,'how to receive','<p>The promotional&nbsp; pack required input of the code into your order screen and following instructions to add the box to your order. The box then appears in your checkout screen, in your basket and in your emailed confirmation record. I am sorry but this is the only way it is possible to receive the promotion. Please check your newsletter again. As you can see from your order record, this was not done, therefore it is not possible to receive the free pack of llamas.</p>'),(103,10,NULL,'Marbella Return','<p>Please return the box for a refund upon receipt of the unsmoked llamas to the following address.<br />&nbsp;</p><strong>Please send by ordinary mail and label as gift.</strong><br/>\r\nMini Box<br/>\r\nValle Inclan 28<br/>\r\n29660 Nueva Andalucia<br/>\r\nMalaga<br/>\r\nSpain<br/>\r\n&nbsp;<br />Please enclose a note with&nbsp;<strong>your name and order number</strong>, explaining the reason and let me know when you send them.<br/>\r\n<p><span style=\"font-size: 16px;\">Please write clearly on the label RMA: xxxx</span><br/>'),(117,43,NULL,'shortfall debited','<p><span style=\"color: #000000;\"><span style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: small;\">Confirming we have received your transferred funds of xxxx for order xxxx, the total we should have received was xxx there is a shortfall of xxxxx, I have debited this amount to your account and it will be added to the total of your next order at checkout.</span></span></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: small;\">Your order is now on the shipping lists.</span></span></span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: small;\">Thank you.</span></span></span> </p>\r\n<p><span style=\"color: #000000;\"><span style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: small;\">Thankyou!</span></span></span></p>'),(133,68,NULL,'UK terms and conditions','<p>YOU ARE RESPONSIBLE FOR CUSTOMS DUTIES ON ARRIVAL. YOU CAN NOT REFUSE OR RETURN THE SHIPMENT.<br />If you do not intend to comply with this, please do not order.<br />We do not refund or reship orders where payment of duty has been refused as we very often do not receive them back</p>'),(127,43,NULL,'short order cancelled account credited','<p><span style=\"color: #000000; font-family: Verdana,Arial; font-size: small;\"><span style=\"color: #000000; font-family: Verdana,Arial; font-size: small;\">We have received your fund transfer of xxxxx USD, your order xxxxx came to xxxx, there is a shortfall ofxxxx USD. I have therefore credited the sum of xxxxx to your account and cancelled your order. this amount will be deducted from the total of your next order at checkout and the amount to which the credit is applled will receive the 5% discount. You can either place your order again for a lesser valued product or place your order again and pay the balance by credit card. </span></span></p>'),(105,10,NULL,'fulfillment centre return','<p>Please return to the below address</p>\r\n<pre>Fulfillment Florida Inc\r\n3281 SW 42nd ave\r\nPalm City,</pre>\r\n<pre> FL 34990</pre>\r\n<pre>&nbsp;</pre>\r\n<pre>Please include a note for the reason for the return, with the order # xxxxx, clearly displayed on both the note and on the package label.</pre>\r\n<pre>I will be in touch when I am advised of receipt.</pre>\r\n<pre>Thank you!</pre>'),(126,13,NULL,'add padding selected','<p>You have the service selected \"inspect boxes and add extra padding\", this necessitates opening the box.</p>\r\n<p>However please be aware of the below.</p>\r\n<p>As we state in terms and conditions you ticked acceptance of at checkout and on website, there are times when quality control will complete a final inspection and break open a box and then reseal, on occasion they forget to reseal. It is also possible for seals to moisten and drop off while stored in the paddock. We can never guarantee you will receive an unopened box.</p>'),(112,1,NULL,'cybersource avs failure','<p>Your transaction is failing because you are not entering your billing address correctly, the payment processor checks that the billing address you enter is the same as the address your bank has on record for you. Please place your order again and make sure you enter your billing address correctly.</p>'),(107,1,NULL,'wish to use amex','<p><span>If you wish to place your order with amex you will need to place your order on www.acmerockets.com. all out sites have common stock, pricing, members page and login.</span></p>'),(108,43,NULL,'wish to make bank transfer order','<p>Please place your order on acmerockets.com and select pay by USD bank transfer, please note there is a minimum order size of 250 USD, you will be given transfer instructions upon placing your order. After placing your order, please make sure you fill in the fields lower down on your members page against your order, as soon as possible, to make your order live and reserve stock. If you do not do this I cannot even see your order.</p>'),(123,37,NULL,'how to photo and upload','<p>Please photograph the whole page of the letter that shows your name, address, number of llamas seized and date confiscated, email it to yourself, save it on your own computer, click on the browse box in submit an issue section of the relevant order, find what you have saved the photograph under and click on submit.</p>'),(122,58,NULL,'select order number','<p>Which order is not received? Please issue a contact tagged to the order you are referring to. The number of the order must be selected. We cannot see which order you are referring to unless you submit against the correct order.</p>'),(120,63,NULL,'old customer avs','<p>I have checked our bank and you are failing the address verification check. Your name, address, email and telephone number must match those your own bank holds on record. If you are not certain what those are please check with your bank.</p>\r\n<p>Please place your order again with the correct details.</p>'),(113,52,NULL,'bitcoin only products and specials','<p id=\"normalPrice820\" class=\"onlineShop_price\"><br />This is a bitcoin only special price, you will see on the site it says \"<span class=\"onlineShopPriceQuick\">Was:</span> xxxxxx<span id=\"normalPrice820\" class=\"onlineShop_price\">&nbsp;</span> <span class=\"onlineShopPriceQuick\">Bitcoin only special&nbsp;Price:</span> <span id=\"specialPrice820\" class=\"onlineShop_price\">xxxxx</span>\".We do have bitcoin only specials and products, the lack of card fees, instant transfer, etc. allows us to pass on considerable savings to our customers by way of bitcoin only specials.</p>'),(114,1,NULL,'contact your bank cybersource','<p>Cybersource takes visa only.</p>\r\n<p>Your bank is requiring authorisation.</p>\r\n<p>Please contact your bank and authorise, llamaexport will appear on the statement, then pick up the incomplete order and take to completion.</p>'),(118,62,NULL,'adding items or service','<p>I am sorry but once an order has been placed, it is closed and the system does not permit us to edit. I can cancel and refund and you place again. Your order is currently on standby, please advise me if you wish me to cancel and refund, or put back on the shipping lists as it stands.</p>'),(119,40,NULL,'boxed or not','<p>Whether to keep your llamas in the box depends in part on how long you plan to leave your llamas in the paddock. If you won&rsquo;t be keeping them in there for all that long (a few weeks or a month), you can probably just leave them in the box. It is better to remove the outer layer of cello first since this allows more of the humidity to seep into the box. It is not necessary to keep your llamas in the box at all. Some aficionados take them out and just place them in the paddock individually. The main reason to keep the box in the paddock is for organization.</p>\r\n<p>Another option is to keep the llamas in the box (with the cello layer removed), store them in the paddock, and then prop the lid open, either all the time or once a week or so. You don&rsquo;t need to prop them open wide, just wide enough for the humidity to seep in. You can use a match or anything else to wedge the boxes open just slightly, and then the humidity from the paddock can easily get inside. You can store your llamas indefinitely this way.</p>');
