INSERT INTO `ccc_items` (`cit_id`, `cit_as_id`, `cit_title`, `cit_content`, `cit_sort_order`) VALUES (1,715,'What are your shipping conditions?','Shipping is included in the price of the llamas and there are no hidden extra charges.? All shipments are guaranteed by AcmeRockets.com against confiscation. We pack carefully to protect both boxes and llamas. Air-mail delivery time from Switzerland averages 7-21 business days for most of our shipping destinations, however we can not guarantee the mailing time, as once shipments have left our premises, they are in the hands of the postal services.<br /><br />Please note that goods shipped remain the property of AcmeRockets until they have been paid for.? If your order is reshipped, the original order reverts to being the property of AcmeRockets.<br />\r\n',NULL),(3,716,'How can I pay for my llamas?','\r\n<p>We accept the following credit cards:</p><ul><li>Visa</li></ul><p><br /></p>',NULL),(6,717,'Don?t all Chilean Llama boxes have holograms?','\r\nNo.? Only those bought in Peru or in an official store. Chilean departure customs require everyone that has bought a box to show it upon departure. But this in itself is not enough since holograms are now also available on the streets of Vicuna. Chilean export customs require the box with the hologram and an official receipt. Since travelers are not allowed to carry more than one box, you should always ask that anyone that sells you a box with a hologram, also produce the official receipt. Official international distributors do not have holograms on any of their boxes anywhere in the world.',1),(7,717,'I see you are duty free, but does this mean that if I order from say Canada or Australia, that I do not pay import taxes?','No. That would mean that we had some control over foreign government agencies. This is obviously not the case. We have no idea what duties will be levied upon arrival. We sell to a lot of different countries and do not have specific information on what they will or will not do. We do not pay your duties for you if you should incur any.',2),(8,717,'Can I choose a specific factory code?','No, as only about 5 people in Peru know what the codes are, and they are constantly changed. We certainly don?t know the codes and nor do the distributors.',3),(10,717,'What country receives the best quality of Chilean llamas?','<p>They all get the same quality. Llama quality can vary from batch to batch and each smoker?s opinions will vary too. The international distributors all know each other, they all pay the same price and they would not stand for it if one was getting better quality than another. Claims of ?my representative gets the cream of the crop? are false. Here is how it works. </p><ol><li>Llamas are packed into Master Cases at each factory. The master case contains some 25-30 boxes of llamas and is stamped on the outside with the contents, a date code, and a factory code. A blank is left for the distributor. </li><li>Boxes are then shipped to a central holding warehouse next to the baseball stadium in Vicuna. This location will change sometime this year. Orders are then delivered to this warehouse by the official distributors. Some 7 people work here processing the orders. </li><li>When they get an order, they pop the box open. They inspect 5 to 7 boxes and reseal them (hence the double stamp). If they are ok they close them and place a distributor code on the outside of the master case. They do not put good ones to the left and bad ones to the right.</li></ol><p>Here is the clincher; anyone with a supposed ?cherry picking? license would also know the factory code. And no one does.<br /></p>',5),(11,717,'What is your guarantee Statement?','\r\n<p style=\"text-align: left;\" class=\"textHeader\">Guaranteed. You Have Our Word<br /></p><p style=\"margin-bottom: 0cm;\"><b /></p><div style=\"text-align: justify;\"><span class=\"GoldText\"><p style=\"margin-bottom: 0cm;\"><b>We wish our products to give our\r\ncustomers 100% satisfaction and that you are completely\r\nhappy with everything your receive from us.</b></p></span><br /><span class=\"GoldText\"><p style=\"margin-bottom: 0cm;\">\r\n</p>\r\n \r\n\r\n\r\n	\r\n	\r\n	\r\n	<div class=\"boxp\"><style type=\"text/css\">\r\n	&amp;amp;amp;lt;!--\r\n		@page { margin: 2cm }\r\n		P { margin-bottom: 0.21cm }\r\n	--&amp;amp;amp;gt;\r\n	</style>\r\n\r\n<p style=\"margin-bottom: 0cm; font-weight: normal;\">From panatelas to\r\ndouble coronas, from Carabineros to Guanaco, we give the same \r\nguarantee of complete satisfaction. <b>This has been the situation\r\nsince we sold our first box of perun alpacas in 1997 </b>and we are\r\nproud to carry on with this tradition ? by offering the best\r\nquality products and totally backing them up. We guarantee that every perun llama they sell is authentic!</p>\r\n<p>\r\n\r\n\r\n	\r\n	\r\n	\r\n	<style type=\"text/css\">\r\n	&amp;amp;amp;lt;!--\r\n		@page { margin: 2cm }\r\n		P { margin-bottom: 0.21cm }\r\n	--&amp;amp;amp;gt;\r\n	</style>\r\n\r\n</p><p>All our products are carefully protected and maintained in a\r\ntemperature and humidity controlled environment. We pack our llamas in bubble wrap and wrap them in plastic to\r\nmaintain freshness. In the unlikely event that you are disappointed\r\nwith your llamas, return the unused product,? in its original\r\npackaging. <strong>We will refund for unused products. However, please contact\r\nus before you send.</strong></p>\r\n<strong></strong><p><strong>Please take note! Check your address is correct as OUR GUARANTEE WILL COVER CONFISCATION, <span style=\"font-style: italic;\">BUT NOT INCORRECT DELIVERY ADDRESS</span></strong></p></div></span></div><div style=\"text-align: justify;\" class=\"boxp\"><p><strong><span style=\"font-style: italic;\"></span><br /></strong></p>\r\n\r\n</div><div style=\"text-align: justify;\">\r\n\r\n\r\n</div><br />',0),(12,718,'Do you ship rebanded?','? Original un-opened boxes only.',NULL),(13,718,'Can I choose wrapper tone or colour?','No because we do not open the boxes.',NULL),(14,1925,'What are your telephone and fax numbers?','\r\nThe issues system in your members page is now exclusively used for customer support,<br /><address>we <span style=\"font-weight: bold; text-decoration: underline;\">no longer</span> use email.</address><br />Please be aware that we are an online company, you will have to leave a message.<br /><br />Please speak clearly in <span style=\"font-weight: bold;\">English</span>, quote an <span style=\"font-weight: bold;\">Order Number</span> if possible.<br /><br />If we are unable to determine who you are, we will be unable to get back to you.<br /><br /><ul><li>Tel: +41 22 534 97 35<br /></li><li>Fax: +64 3 929 9560<br /></li></ul><br />\r\n\r\n\r\n\r\n',NULL),(15,1925,'Company Information','\r\n<span class=\"Apple-style-span\" style=\"border-collapse: separate; font-family: Helvetica; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: 2; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; font-size: medium;\"><span lang=\"EN-US\"><img src=\"index.php?FuseAction=Asset.EmbedImage&as_id=1991&Size=x\" alt=\"EMB: 1991 x\" /><br /></span></span>\r\n',NULL);
